import React from "react";
import Navbar from "./Navbar";


const ReqData1 = async () => {
    try {
        var a1 = document.querySelector("#Auser1").value;
        var a2 = document.querySelector("#Apasword1").value;
        if (a1 != "" && a2 != "") {
            const res = await fetch("http://192.168.1.2:8000/admin_login", {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    username: a1,
                    password: a2
                })
            });
            document.querySelector("#pform1").reset();
            const fdata = await res.json();
            if (fdata.status) {
                window.location.href = "/admin/dashboard";
            } else {
                alert("Something went Wrong 404 Surver error");
            }

        } else {
            alert("Fill All The Details");
        }

    } catch (error) {
        console.log(error);
    }
}


const Admin_login = () => {
    return (
        <>
            <Navbar />
            <div className="container bg-ligh mt-5 back">
                <div className="row d-flex justify-content-center align-items-center height bg-light">
                    <div className="col-6 form1">
                        <h2 className="text-center mb-5 py-2 rounded bg-danger text-white"> Admin Login</h2>

                        <form className="form1" id="pform1">
                            <div className="mb-3">
                                <label for="exampleInputEmail1" className="form-label"> <h4> User Name </h4> </label>
                                <input type="email" class="form-control" id="Auser1" aria-describedby="emailHelp" />
                                <div id="emailHelp" class="form-text"> <h6> We'll never share your email with anyone else. </h6> </div>
                            </div>
                            <div className="mb-3">
                                <label for="exampleInputPassword1" className="form-label"> <h4> Password  </h4> </label>
                                <input type="password" class="form-control" id="Apasword1" />
                            </div>
                            <div className="btn btn-dark" onClick={ReqData1}>Submit</div>
                        </form>

                    </div>
                </div>
            </div>
        </>)
}

export default Admin_login;
